    def test_copy_benchmark(self):
        """best:
        0.50.2: 0.1568sec
        0.50.3: 0.0356
        0.50.4: 0.0354
        """
        col = collection.get_collection(
            manufacturer=b"KPZ",
            server_type=cdt.OctetString("4d324d5f33"),
            server_ver=AppVersion.from_str("1.4.13"))
