    def test_get_phases_amount(self):
        type_ = "4d324d5f31"
        ver = "1.5.7"
        man = b"KPZ"
        col = collection.get(
            m=man,
            t=cdt.OctetString(type_),
            ver=AppVersion.from_str(ver))
        self.assertEqual(col.get_n_phases(), 1, "check amount")
        type_ = "4d324d5f33"
        ver = "1.5.7"
        man = b"KPZ"
        col = collection.get(
            m=man,
            t=cdt.OctetString(type_),
            ver=AppVersion.from_str(ver))
        self.assertEqual(col.get_n_phases(), 3, "check amount 3")
